import React from 'react';
import '../index.scss';

const Header = () => {
  return (
    <header class="header">
      <div class="main-ico">
        <img src="/img/main-ico.png" alt="" />
        <h1>React-store</h1>
      </div>
      <input type="text" placeholder="Введите ваш запрос..."></input>
      <div class="icons">
        <span>0 руб.</span>
        <img src="/img/like.png" alt="" />
        <img src="/img/pack.png" alt="" />
        <img src="/img/bought.png" alt="" />
      </div>
    </header>
  );
};

export default Header;
